package Collection.Collection_tYPE;import java.util.HashMap;public class Collection_HashMap {    public static void main(String[] args) {        HashMap hm=new HashMap();        hm.put(101,"anuj");        hm.put(102,"sarvesh");        hm.put(103,"tejash");        hm.put(104,"aditya");        hm.put(105,"yash");        System.out.println(hm);        hm.remove(105);        System.out.println(hm);        System.out.println(hm.size());        System.out.println(hm.values());        System.out.println(hm.keySet());        System.out.println(hm.get(104));    }}